window.bookSummaryJSON = "<p>Rogue wizard Josiah Quinn never met a rule he wouldn’t break. Even though he knows he’ll face plenty of backlash from both good and evil, he braves the fires of Hell to spring Satan’s captive daughter. But before they return to their lives, he’s got to track down the missing pieces of her soul....</p> <p>As he attempts to unite the fragmented spirit of the succubus by his side, Josiah has one little problem: a power-hungry wizard aiming to rule the underworld. And since that handsome devil also happens to be his old flame, fighting to protect millions of innocent lives is like battling his own heart.</p> <p>With New York City in the crossfire, can Josiah pull off the impossible before all Hell breaks loose?</p>"; 
